  \"\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\": \"[\"Use Constraints:
  The data, digital results, GIS layers, and map products in this database have been
  created specifically as part of a pilot study for FEMA's modernization of Flood
  Insurance Rate Maps (FIRMs) project. The results of the pilot study are intended
  to help FEMA draft new guidelines related to tsunami flooding for Coastal Flood
  Hazard Analysis and Mapping for the Pacific Coast of the United States. The results
  are intrinsically probabilistic and designed according to FEMA flood zone specifications:
  annual probabilities of exceedance of 1% and 0.2%. The data, digital results, GIS
  layers, and map products are not intended for other uses. In particular, the 1%
  and 0.2% annual exceedance probability tsunami flood maps are not to be used for
  emergency planning, evacuation, or other insurance purposes. Please refer to the
  National Tsunami Hazard Mitigation Program tsunami inundation maps for use in emergency
  planning. Please recognize the U.S. Geological Survey (USGS) as the source of this
  information.\", \"Access Constraints: None.\"]\"\n\t},\n\t{\n\t\t\"key\": \"graphic-preview-file\",\n\t\t\"value\":
